package math;////  ConstantEvaluation.javaimport math.ComplexVarList;//  ResFracti////  Created by Michael Rule on Mon Apr 04 2005.//  Copyright (c) 2005 __MyCompanyName__. All rights reserved.//public class ConstantEvaluation implements EvaluationOperation{        private final complex myConstant;        public ConstantEvaluation(float C)    {        myConstant = new complex(C);    }    public ConstantEvaluation(complex C)    {        myConstant = new complex(C);    }        public boolean equals(int id)    {        return id == 0;    }        public complex operate(ComplexVarList variables)    {        return myConstant;    }        public String toString()    {        return myConstant.toString();    }        public boolean is_analytic()    {        return true ;    }}